user_pref("launchpadimprovements.pref.comment0", "Thank you for taking the time to report this bug and helping to make Ubuntu better. Unfortunately, we can't fix it because your description didn't include enough information.  You may find it helpful to read \"How to report bugs effectively\" http://www.chiark.greenend.org.uk/~sgtatham/bugs.html. We'd be grateful if you would then provide a more complete description of the problem.  We have instructions on debugging some types of problems at http://wiki.ubuntu.com/DebuggingProcedures.\nAt a minimum, we need:\n1. the specific steps or actions you took that caused you to encounter the problem,\n2. the behavior you expected, and\n3. the behavior you actually encountered (in as much detail as possible).\n\nWhen reporting bugs in the future please use apport, either via the appropriate application's \"Help -> Report a Problem\" menu or using 'ubuntu-bug' and the name of the package affected.  You can learn more about this functionality at https://wiki.ubuntu.com/ReportingBugs.\n\nThanks!");
user_pref("launchpadimprovements.pref.comment1", "Thank you for taking the time to report this bug and helping to make Ubuntu better. Please answer these questions:\n\n1. Is this reproducible?\n2. If so, what specific steps should we take to recreate this bug? Be as detailed as possible.\n\nThis will help us to find and resolve the problem.");
user_pref("launchpadimprovements.pref.comment10", "Thank you for taking the time to report this bug and helping to make Ubuntu better. Please attach your X server configuration file (/etc/X11/xorg.conf) and X server log file (/var/log/Xorg.0.log) to the bug report as individual uncompressed file attachments using the \"Attachment:\" box below. Could you please also try to run without any /etc/X11/xorg.conf and let Xorg autodetect your display and video card? When you do please also attach the /var/log/Xorg.0.log from this attempt. Thanks in advance.");
user_pref("launchpadimprovements.pref.comment11", "Thank you for taking the time to report this bug and helping to make Ubuntu better. Unfortunately, we can't start working on it yet, because your description didn't include enough information.  Please include the information requested at https://wiki.ubuntu.com/DebuggingUbiquity/AttachingLogs as separate attachments.  Thanks in advance.");
user_pref("launchpadimprovements.pref.comment12", "Thanks for taking the time to report this bug and helping to make Ubuntu better. Could you please add the log files from '/var/log/dist-upgrade/' to this bug report as separate attachments? Thanks in advance.");
user_pref("launchpadimprovements.pref.comment13", "Thanks for taking the time to report this bug and helping to make Ubuntu better.  Could you please attach the resulting log file of: gnome-power-bugreport.sh & > gpm.log to the report?  You might also want to take a look at the debugging instructions located at https://wiki.ubuntu.com/DebuggingGNOMEPowerManager and submit any other logs related to your problem.  Thanks in advance.");
user_pref("launchpadimprovements.pref.comment14", "Thank you for taking the time to report this bug and helping to make Ubuntu better. Unfortunately we can't start working on it yet, because your bug report didn't include enough information.\n\nPlease include the information requested at https://wiki.ubuntu.com/DebuggingNetworkManager. If you have trouble, please do not hesitate to ask for more assistance. Thanks in advance.");
user_pref("launchpadimprovements.pref.comment15", "Thank you for taking the time to report this bug and helping to make Ubuntu better. Unfortunately we can't fix it without more information. \n\nPlease include the information requested at https://wiki.ubuntu.com/DebuggingSamba#samba-client.");
user_pref("launchpadimprovements.pref.comment16", "Thank you for taking the time to report this bug and helping to make Ubuntu better. Unfortunately we can't fix it without more information. \n\nPlease include the information requested at https://wiki.ubuntu.com/DebuggingSamba#samba-server.");
user_pref("launchpadimprovements.pref.comment17", "Thank you for taking the time to report this bug and helping to make Ubuntu better. This bug did not have a package associated with it, which is important for ensuring that it gets looked at by the proper developers. You can learn more about finding the right package at https://wiki.ubuntu.com/Bugs/FindRightPackage. I have classified this bug as a bug in PKGNAME. If you believe that I have chosen the wrong package, please change your bug to the correct one. Good luck on getting it fixed!");
user_pref("launchpadimprovements.pref.comment18", "This bug report is being closed due to your last comment regarding this being fixed with an update. For future reference you can manage the status of your own bugs by clicking on the current status in the yellow line and then choosing a new status in the revealed drop down box. You can learn more about bug statuses at https://wiki.ubuntu.com/Bugs/Status. Thank you again for taking the time to report this bug and helping to make Ubuntu better. Please submit any future bugs you may find.");
user_pref("launchpadimprovements.pref.comment19", "Thank you for taking the time to report this bug and helping to make Ubuntu better.  The issue that you reported is one that should be reproducible with the live environment of the Desktop CD of the development release.  It would help us greatly if you could test with it so we can work on getting it fixed in the next release of Ubuntu.  You can find out more about the development release at http://www.ubuntu.com/testing/.  Thanks again and we appreciate your help.");
user_pref("launchpadimprovements.pref.comment2", "Thank you for taking the time to report this bug and helping to make Ubuntu better. Unfortunately, we can't fix it without more information.\n\nPlease run the following command which will attach necessary information:\n\napport-collect BUGNUMBER\nif you are using Karmic Koala (9.10) or newer, or\n\napport-collect -p linux-image-`uname -r` BUGNUMBER\nif you are using Jaunty Jackalope (9.04).\n\nBear in mind that you may need to install the python-launchpadlib package from the universe repository with 'sudo apt-get install python-launchpadlib'. Additionally, when prompted to give apport-collect permissions for Launchpad you will need to give it at least the ability to \"Change Non-Private\" data as it will be adding information to your bug report.\n\nIf you are using an older release or cannot use apport please at least add the following information (pay attention to lspci's additional options):\n\nFirst run the following commands:\n\n1) uname -a > uname-a.log\n2) dmesg > dmesg.log\n3) sudo lspci -vvnn > lspci-vvnn.log\n4) cat /proc/version_signature > version.log\nthen attach the files separately to the bug report (not pasted into comments or tar/zip-ed).\n\nFor your reference, the full description of procedures for kernel related bug reports is available at https://wiki.ubuntu.com/KernelTeam/KernelTeamBugPolicies. Thanks in advance!");
user_pref("launchpadimprovements.pref.comment20", "Thank you for taking the time to report this bug and helping to make Ubuntu better. This particular bug has already been reported and is a duplicate of bug NUMBER, so it is being marked as such. Please look at the other bug report to see if there is any missing information that you can provide, or to see if there is a workaround for the bug.  Additionally, any further discussion regarding the bug should occur in the other report.  Please continue to report any other bugs you may find.");
user_pref("launchpadimprovements.pref.comment21", "Thank you for taking the time to report this bug and trying to help make Ubuntu better.  However, it seems that you are not using a software package provided by the official Ubuntu repositories.  Because of this the Ubuntu project can not support or fix your particular bug.  Please report this bug to the provider of the software package.  Thanks! \nIf you are interested in learning more about software repositories and Ubuntu the following pages should be informative:\n\n1. http://www.ubuntu.com/community/ubuntustory/components - information about Ubuntu repositories\n2. https://help.ubuntu.com/community/Repositories - information regarding managing repositories.");
user_pref("launchpadimprovements.pref.comment22", "Thank you taking the time to report this bug and helping to make Ubuntu better. However, processing the crash report to get detailed information for the developers failed as the retracer did not generate a useful symbolic stack trace.  \nPlease try to obtain a backtrace manually following the instructions at http://wiki.ubuntu.com/DebuggingProgramCrash and upload the backtrace (as an attachment) to the bug report. This will greatly help us in tracking down your problem.");
user_pref("launchpadimprovements.pref.comment23", "Thank you for bringing this bug to our attention. However, a paper cut should be a small usability issue, in the default Ubuntu installation, that affects many people and is quick and easy to fix. So this bug can't be addressed as part of this project.  \n\n+EXPLANATION WHY BUG IS NOT A PAPERCUT+\n\nFor further information about papercuts criteria, please read https://wiki.ubuntu.com/PaperCut.\n\nDon't worry though, this bug has been marked as \"Invalid\" only in the papercuts project.");
user_pref("launchpadimprovements.pref.comment24", "This bug is an upstream one and it would be quite helpful if somebody experiencing it could send the bug the to the people writing the software.  You can learn more about how to do this for various upstreams at https://wiki.ubuntu.com/Bugs/Upstream.  Thanks in advance!");
user_pref("launchpadimprovements.pref.comment25", "Thanks for taking the time to report this bug in the upstream bug tracking system this is a tremendous help.  Launchpad has the ability to watch lots of upstream bug trackers and this can be done by following the procedure documented at https://wiki.ubuntu.com/Bugs/Watches.  I've added the bug watch for this bug report.");
user_pref("launchpadimprovements.pref.comment26", "Thank you for taking the time to report this bug and helping to make Ubuntu better. Please execute the following command, as it will automatically gather debugging information, in a terminal:\n\napport-collect BUGNUMBER\n\nThis will help us to find and resolve the problem. Bear in mind that you may need to install the python-launchpadlib package from the universe repository.  Additionally, when prompted to give apport-collect permissions for Launchpad you will need to give it at least the ability to \"Change Non-Private\" data as it will be adding information to your bug report.  Thanks in advance!\n\nWhen reporting bugs in the future please use apport, either via the appropriate application's \"Help -> Report a Problem\" menu or using 'ubuntu-bug' and the name of the package affected.  You can learn more about this functionality at https://wiki.ubuntu.com/ReportingBugs.");
