user_pref("launchpadimprovements.pref.comment64", "Thanks for reporting this bug and any supporting documentation. Since this bug has enough information provided for a developer to begin work, I'm going to mark it as confirmed and let them handle it from here. Thanks for taking the time to make Ubuntu better! ");
user_pref("launchpadimprovements.pref.comment65", "Thanks for taking the time to report his bug and comment on it. However, I've noticed that this bug has been Confirmed although there is not clear indication as to how to recreate this bug [ or version of software affected ]. Subsequently, I'm setting its status to Incomplete until that information is provided. You can learn more about bug statuses at http://wiki.ubuntu.com/Bugs/Status. Thanks for taking the time to make Ubuntu better! ");
user_pref("launchpadimprovements.pref.comment66", "Looking at the attachments in this bug report, I noticed that an attachment was not flagged as a patch. A patch contains changes to an Ubuntu package that will resolve a bug and this attachment is one! Subsequently, I've checked the patch flag for it. In the future when submitting patches please use the patch checkbox as there are some Launchpad searches that use this feature. You can learn more about the patch workflow at https://wiki.ubuntu.com/Bugs/Patches. ");
user_pref("launchpadimprovements.pref.comment67", "Looking at the attachments in this bug report, I noticed that one was flagged as a patch incorrectly. A patch contains changes to an Ubuntu package that will resolve a bug, since this was not one I've unchecked the patch flag for it. In the future keep in mind the definition of a patch. You can learn more about what qualifies as a patch at https://wiki.ubuntu.com/Bugs/Patches. Thanks! ");
user_pref("launchpadimprovements.pref.comment68", "Thank you for your report. This package failure looks like being caused by a corrupted file system. Please start the \"Memory check\" from the boot menu. If that runs successfully, please start the rescue system in the boot menu and select the \"File system check\" option in the next menu. If the file system corruption is serious, the safest option would be to reinstall your system. ");
user_pref("launchpadimprovements.pref.comment7", "Thank you for taking the time to report this bug and helping to make Ubuntu better. Unfortunately we can't fix it without more information.  Please include the information requested at https://wiki.ubuntu.com/DebuggingHardwareDetection as separate attachments.");
user_pref("launchpadimprovements.pref.comment8", "Thank you for taking the time to report this bug and helping to make Ubuntu better. Unfortunately we can't fix it without more information.  Please include the information requested at https://wiki.ubuntu.com/DebuggingUSBStorage as separate attachments.");
user_pref("launchpadimprovements.pref.comment9", "Thank you for taking the time to report this bug and helping to make Ubuntu better. Unfortunately we can't fix it without more information.  Please include the information requested at https://help.ubuntu.com/community/DebuggingXAutoconfiguration as separate attachments.");
